import React from "react";
import "./skills.css";

const skills = [
  {
    name: "HTML",
    color: "#E34F26",
    svg: (
      <svg viewBox="0 0 128 128">
        <path fill="#E34F26" d="M19 0l10 113 35 10 35-10 10-113z"/>
        <path fill="#EF652A" d="M64 117l28-8 8-90H64z"/>
        <path fill="#fff" d="M64 52H49l1 13h14v12l-13-4-1-9H39l2 20 23 6z"/>
        <path fill="#fff" d="M64 52V40H37l1 12z"/>
      </svg>
    )
  },
  {
    name: "CSS",
    color: "#1572B6",
    svg: (
      <svg viewBox="0 0 128 128">
        <path fill="#1572B6" d="M19 0l10 113 35 10 35-10 10-113z"/>
        <path fill="#33A9DC" d="M64 117l28-8 8-90H64z"/>
      </svg>
    )
  },
  {
    name: "JavaScript",
    color: "#F7DF1E",
    svg: (
      <svg viewBox="0 0 128 128">
        <path fill="#F7DF1E" d="M1 1h126v126H1z"/>
        <path d="M67 106c2 4 5 7 10 7 4 0 7-2 7-5 0-4-3-5-8-7l-3-1c-9-4-15-8-15-18 0-9 7-16 18-16 8 0 13 3 17 10l-9 6c-2-4-4-5-8-5-4 0-6 2-6 5 0 3 2 5 7 7l3 1c10 4 16 8 16 19 0 11-9 17-21 17-12 0-19-6-23-14z"/>
      </svg>
    )
  },
  {
    name: "React",
    color: "#61DAFB",
    svg: (
      <svg viewBox="0 0 128 128">
        <circle cx="64" cy="64" r="11" fill="#61DAFB"/>
        <g fill="none" stroke="#61DAFB" strokeWidth="6">
          <ellipse rx="56" ry="24" cx="64" cy="64"/>
          <ellipse rx="56" ry="24" cx="64" cy="64" transform="rotate(60 64 64)"/>
          <ellipse rx="56" ry="24" cx="64" cy="64" transform="rotate(120 64 64)"/>
        </g>
      </svg>
    )
  }
];

const Skills = () => {
  return (
    <section className="skills">
      <h2>My Skills</h2>
      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div className="skill-card" key={index}>
            <div className="skill-icon" style={{ color: skill.color }}>
              {skill.svg}
            </div>
            <p>{skill.name}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Skills;
